/// <summary>
///    The <c>TrvDimensionValue</c> class is the data contract class that represents dimensions data
/// </summary>
[DataContractAttribute]
class TrvDimensionValue
{
    Name dimensionAttributeName;
    DimensionValue dimensionValue;
    Name dimensionValueDescription;
}

